syntax = "proto3";

package zproto;

import "enum_e_error_code.proto";
import "stru_exchange_sell_item_data.proto";

message ExchangeSellItemReply {
    repeated zproto.ExchangeSellItemData items = 2;
    repeated zproto.ExchangeSellItemReply.WithDrawItemEntry withDrawItem = 3;
    int32 limit = 4;
    int32 rate = 5;
    zproto.EErrorCode errCode = 6;
}
